f = open("text.txt", "r")
n = open("frequency.txt", "w")

dict = {}

for line in f:
    parsed_line = line.split(" ")
    for word in parsed_line:
        if word in dict:
            dict[word] += 1
        else:
            word = word.replace("\n","")
            dict[word] = 1

for item in dict:
    entry = str(item) + ": " +  str(dict[item]) + "\n"
    n.write(entry)

f.close()
n.close()
